import * as React from "react";
import { Routes, Route, Link} from "react-router";
import "./App.css";
import Portfolio from "./views/portfolio";

function App() {
  return (
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
  );
}
function Home() {
  return (
    <>
      <main>
        <h2>Welcome to the homepage!</h2>
        <p>You can do this, I believe in you.</p>
      </main>
    </>
  );
}
export default App();
